import React from 'react';
import '../styles/About.css';

class About extends React.Component {
  render() {
    return (
      <div className="about-container">
        <h1>About Us</h1>
        <p>Techbitz is a leading technology solutions provider. Our team comprises dedicated professionals who specialize in various technological fields, enabling us to deliver high-quality services. Our commitment to excellence and our passion for technology make us the ideal partner for all your tech needs.</p>
      </div>
    );
  }
}

export default About;
